import React from 'react';

const UserPanel = ({ name, email, grade, reaction }) => {
    return (
        <div className={"User"}>
            <h1>Youssif Ayman</h1>
            <p>{name}</p>
            <p className={"hidden"}>Email: {email}</p>
            <p className={"hidden"}>Grade: {grade}</p>
            <p className={"hidden"}>Reaction: {reaction}</p>
        </div>
    );
};

export default UserPanel;
